import React from "react";

function Mission() {
    return (
        <section id="mission" className="section animated slideInRight">
            <h2>Our Mission</h2>
            <p>
                Our mission is to provide personalized, quality education resources to empower every
                student to achieve academic and personal breakthroughs.
            </p>
        </section>
    );
}

export default Mission;
